import ExpenseItem from './components/ExpenseItem.js';

function App() {
	const expenses = [
		{ id: 'e1', title: '과자구매', amount: 94.12, date: new Date(2020, 7, 14) },
		{ id: 'e2', title: '외식비', amount: 94.12, date: new Date(2020, 7, 14) },
		{ id: 'e3', title: 'Toilet pater', amount: 294.62, date: new Date(2020, 7, 14) },
		{ id: 'e4', title: 'Toilet pater', amount: 450, date: new Date(2020, 7, 14) },
	];
	return (
		<div>
			<h2>Let's get started!</h2>
			<ExpenseItem />
		</div>
	);
}

export default App;
